import React from 'react';
import { NavLink } from 'react-router-dom';

const SimpleNav = () => {
  return (
    <div className="nav-container">
      <div className="nav-buttons">
        <NavLink 
          to="/senior"
          style={{
            color: 'white',
            textDecoration: 'none',
            padding: '0.5rem 1rem',
            backgroundColor: '#3498db',
            borderRadius: '4px',
            minWidth: '150px',
            textAlign: 'center',
            fontWeight: 'bold'
          }}
        >
          Senior Syllabus
        </NavLink>
        <NavLink 
          to="/junior"
          style={{
            color: 'white',
            textDecoration: 'none',
            padding: '0.5rem 1rem',
            backgroundColor: '#2ecc71',
            borderRadius: '4px',
            minWidth: '150px',
            textAlign: 'center',
            fontWeight: 'bold'
          }}
        >
          Junior Syllabus
        </NavLink>
      </div>
    </div>
  );
};

export default SimpleNav;
